import React from "react";
import styled from "styled-components";

const StyledFooter = styled.footer`
  position: absolute;
  right: 0;
  left: 0;
  padding: 1rem;
  text-align: center;
  background-color: white;
`;

function Footer() {
  return <StyledFooter>&copy; Copyright 2020</StyledFooter>;
}

export default Footer;
